import React from "react";
import Slider from "react-slick";
import Head from "next/head";
class SlideShow extends React.Component {
  render() {
    var settings = {
        centerMode: true,
  centerPadding: '60px',
  slidesToShow: 3,
  responsive: [
    {
      breakpoint: 768,
      settings: {
        arrows: false,
        centerMode: true,
        centerPadding: '40px',
        slidesToShow: 3
      }
    },
    {
      breakpoint: 480,
      settings: {
        arrows: false,
        centerMode: true,
        centerPadding: '40px',
        slidesToShow: 1
      }
    }
  ]
    // You can unslick at a given breakpoint now by adding:
    // settings: "unslick"
    // instead of a settings object
  
    };
    return (
        <div>
        <Head>
            <link rel="stylesheet" type="text/css" href="//cdn.jsdelivr.net/npm/slick-carousel@1.8.1/slick/slick.css"/>
            <link rel="stylesheet" type="text/css" href="//cdn.jsdelivr.net/npm/slick-carousel@1.8.1/slick/slick-theme.css"/>
        </Head>
        <div className="container-fluid">
            <div className="">
                    <div className="">
                        <Slider {...settings}>                
                            <div className="m-50">
                                <div className="">
                                    <img className="shadow-lg p-3 bg-white" src="/static/images/test/test1.png" className="img-fluid" />
                                </div>
                            </div>
                            <div>
                                    <img src="/static/images/test/test2.png" className="img-fluid" />
                            </div>
                            <div>
                                    <img src="/static/images/test/test3.png" className="img-fluid" />
                            </div>
                            <div>
                                    <img src="/static/images/test/test4.png" className="img-fluid" />
                            </div>
                        </Slider>
                    </div>

                    
            </div>
            <br/>  
            <br/>  
        </div>
      </div>
    );
  }
}

export default SlideShow;
